import "./footer.css";
function Footer() {
  return (
    <div className="footer">
      <div>
        <img src="images/icon-32-logo 2.svg" alt="" />
        <p>We connect people and removal companies</p>
      </div>
      <div>
        <ul>
            <li>For consumer</li>
            <li>What we do?</li>
            <li>Moving to us</li>
            <li>For consumer</li>
        </ul>
      </div>
    </div>
  );
}

export default Footer;
